		Episode = {
			[1] = {EpisodeTitle = _T("曹焱兵传记1"),Episode = _T("虽然自称魔王，身为罗刹街镇魂将，但曹焱兵却一直都面临着一个巨大的困难，那便是财政赤字！于是乎，威风凛凛的曹魔王只能在平日里依靠送外卖来维持他和弟弟两人的日常开销。也正是在一次送外卖途中，他才与夏铃结缘。")},--常服曹焱兵传记1
			[2] = {EpisodeTitle = _T("曹焱兵传记2"),Episode = _T("曹焱兵和曹玄亮兄弟两人年少时便失去了父母，两人相依为命生活在遍地恶灵的罗刹街，自身的实力便极为重要。因此曹焱兵少年时对更加年幼的弟弟曹玄亮要求极为严格，每日都要与许褚对战，如此才能让弟弟拥有在罗刹街自保的力量。")},--常服曹焱兵传记2
			[3] = {EpisodeTitle = _T("曹焱兵传记3"),Episode = _T("“我去工作了！”曹焱兵跨上摩托车，冲身后摆了摆手。曹玄亮站在他身后，笑着回应：“一路顺风，我会好好看家的。”在夏铃出现之前，这便是兄弟俩的日常，单调却又温馨。若是灵槐树没有发生意外，也许这样平静无忧的生活，兄弟两人可以一直过下去。")},--常服曹焱兵传记3
			[4] = {EpisodeTitle = _T("曹焱兵传记4"),Episode = _T("“我要不要去染个发呢？”夏铃有些犹豫。难得陪夏铃出来逛街的曹焱兵在夏铃旁边停下脚步，看着美发店门前的一块牌子，认真道：“其实我觉得你染个发也不错。”曹焱兵说着指了指染发送不粘锅的牌子，道：“至少我可以拿个锅啊！”从那以后，夏铃开始了吐槽生涯。")},--常服曹焱兵传记4
			[5] = {EpisodeTitle = _T("曹焱兵传记5"),Episode = _T("与曹玄亮不同，曹焱兵的记忆中仍有母亲唐笑笑的身影，幼年调皮的曹焱兵常被唐笑笑倒吊在树上，往往需要父亲求情母亲才会将他放下来。但即使是这样的记忆，仍是曹焱兵心中最为珍贵的财富，虽然他从未说过。但若是用整个天下能换来父母与他和弟弟重聚，他定然毫不犹豫。")}--常服曹焱兵传记5
