			[1] = {EpisodeTitle = _T("曹玄亮传记1"),Episode = _T("上得厅堂，下得厨房的家庭小妇男便是曹玄亮的真实写照。他与哥哥曹焱兵相依为命在罗刹街生活。虽然年纪很小，但同样是一名强大的寄灵人，曹焱兵不在时，他亦可以独当一面，守护罗刹街的安宁。")},--曹玄亮传记1
