		Episode = {
			[1] = {EpisodeTitle = _T("战斗曹焱兵传记1"),Episode = _T("“杂碎们听着！！吾乃罗刹街镇魂将！！曹焱兵是也！！”曹焱兵犹如魔王降世，带着火焰从天而降，将夏铃面前的恶灵尽数烧成灰烬。在罗刹街，他便是当之无愧的王，恶灵都将在他的火焰下颤抖。")},--战斗曹焱兵传记1
			[2] = {EpisodeTitle = _T("灵装曹焱兵传记2"),Episode = _T("与北落师门一战，是曹焱兵所经历过最为艰苦的战斗之一，双方皆在克制范围之内手段尽出。颇有一副英雄惜英雄的感觉。也是因为这场战斗，才让曹焱兵想要将有情有义的北落师门变成自己的伙伴。")},--战斗曹焱兵传记2
			[3] = {EpisodeTitle = _T("灵装曹焱兵传记3"),Episode = _T("“只是，这天下容不下两个王......”曹焱兵明知自己不是项昆仑的对手，却依旧拒绝了对方的邀请，给出了自己的答案。虽然之后便被铁戟刺穿胸膛，近乎身死。但也是因为这句话，他终于得到了夏侯渊和夏侯惇的认可，得以浴火重生，战力再上一个台阶。")},--战斗曹焱兵传记3
			[4] = {EpisodeTitle = _T("灵装曹焱兵传记4"),Episode = _T("与食火蜥吉拉一战，让曹焱兵明白了伙伴的力量必不可少。他不再像以往那样只是一味的单打独斗。面对克制自身的吉拉，他巧妙借助三个伙伴的力量击败了吉拉和他的改造兵团，最终如愿以偿进入了芦花古楼。")},--战斗曹焱兵传记4
			[5] = {EpisodeTitle = _T("灵装曹焱兵传记5"),Episode = _T("为了打听父母的消息，曹焱兵故意战败被擒。在千机黑煞中救出了曾经与母亲并肩作战的伙伴，并在项昆仑未曾回到群英殿时，亲手造就了群英殿之乱。将项昆仑的之前所赐予的一戟之仇，清算了一些。并且真正在风起云涌的灵界之中，拥有了一席之地。")}--战斗曹焱兵传记5
		}
