		Episode = {
			[1] = {EpisodeTitle = _T("提亚马特传记1"),Episode = _T("西方龙是西方神话中可以与神比肩的生物，拥有强壮的身躯，又长又粗的颈，有角或褶边的头，尖锐的牙齿，和一条长长的尾。它的吼声如雷，甚至能控制风火雷电等自然元素，实力极为恐怖。")},--西方龙传记1
			[2] = {EpisodeTitle = _T("提亚马特传记2"),Episode = _T("在人族统治这片大地之前，这片大地的主人据说便是强大的西方龙族。但傲慢自大的西方龙最终触怒了天神，降下神罚毁灭了这个种族，但却有少数实力极为强大的西方龙作为守护灵幸存下来。")},--西方龙传记2
			[3] = {EpisodeTitle = _T("提亚马特传记3"),Episode = _T("化为守护灵存在的西方龙，其实力甚至不弱于传说中的神武灵，即便没有寄灵人它也可以独立存在。千年来从未有人能得到西方龙的认可，成为它的寄灵人，直到那个人的出现……\r\n")},--西方龙传记3
			[4] = {EpisodeTitle = _T("提亚马特传记4"),Episode = _T("王国组织第四骑士，龙王盖文，一个实力深不可测的男人。之所以排在第四，只不过是因为他对所谓的排名毫不在意罢了。即便是第一骑士死神赛伊也对盖文极为忌惮，因为他的守护灵，是传说中比肩众神的西方龙。")},--西方龙传记4
			[5] = {EpisodeTitle = _T("提亚马特传记5"),Episode = _T("雅典海域的一个小镇，有渔民曾见到过一个巨大的身影——传说中的西方龙。强大的西方龙毁灭了敢于靠近它领地的任何事物。但某一天开始，西方龙却突然销声匿迹，却没人注意到小镇中多了个名叫盖文的小伙子")}--西方龙传记5
		}
	},--西方龙
